import request from '@/plugins/axios';

export function list_Users(fromPage, pageNum, likeVal){
    return request.axios({
        url: '/costUser/list',
        method: 'get',
        params: {
            'pageFrom': fromPage,
            'pageNum': pageNum,
            'likeVal': likeVal
        }
    })
}
